        dest: `./${path.dest}`
    },
    cssnano: {
        zindex: false,
        svgo: false, // svgo отключен из-за ie11
        autoprefixer: false,
        reduceIdents: false
    },
    uglify: {
        mangle: {
            keep_fnames: true
